import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <h1>Caitlin Hulsey</h1>
          <br/><br/>
          code / comedy / arts
          <br/><br/>
          Contact: <a className="App-link" href="mailto:caithuls8@gmail.com" target="_blank">caithuls8@gmail.com</a>
        </p>
      </header>
    </div>
  );
}

export default App;
